// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import '../libraries/TransferHelper.sol';
import "../interface/IFund.sol";
import "../interface/IRisk.sol";
import "../interface/ISwapTrade.sol";
import "../interface/IMine.sol";
import "../interface/IPoolFactory.sol";
import "../interface/ITeemoPool.sol";

contract TeemoPool is ERC20("TMOLP", "TMOLP"), ITeemoPool, Ownable {
    using SafeMath for uint256;

    address public tokenAddr;
    address public mainnetTokenAddr;
    address public poolFactoryAddr;
    address public quoteFactoryAddr;

    mapping(string => address) public allModuleInfo;

    address public fundAddr;
    address public riskAddr;
    address public swapTradeAddr;
    address public mineAddr;

    event OpenLimitSwap(bytes32 indexed orderID, uint256 indexed openPrice);
    event CancelLimitSwap(uint256 indexed tokenAmount);
    event TradeLimitSwap(address indexed success,uint256 indexed tokenAmount);
    event OpenMarketSwap(bytes32 indexed orderID, uint256 indexed openPrice);
    event CloseMarketSwap(uint256 indexed closePrice,uint256 indexed plFlag,uint256 indexed plAmount);
    event CloseLimitSwap(address indexed userAddr,uint256 indexed closePrice,uint256 indexed closeType,uint256 plFlag,uint256 plAmount);
    event UpdateSwap(uint256 indexed pLimitPrice, uint256 indexed lLimitPrice);

    event LPDeposit(address _userAddr,uint256 indexed lpAmount,uint256 indexed teemoTokenAmount);
    event LPWithdraw(address _userAddr,uint256 indexed tokenAmount);
    event StartMine(address _userAddr,uint256 indexed tokenAmount,uint256 indexed teemoTokenAmount);
    event StopMine(address _userAddr,uint256 indexed tokenAmount,uint256 indexed teemoTokenAmount);

    function initialize(address _tokenAddr, address _mainnetTokenAddr, address _poolFactoryAddr, address _quoteFactoryAddr) public onlyOwner{
        tokenAddr = _tokenAddr;
        mainnetTokenAddr = _mainnetTokenAddr;
        poolFactoryAddr = _poolFactoryAddr;
        quoteFactoryAddr = _quoteFactoryAddr;
    }

    function setModuleAddr(string memory _moduleName,address _moduleAddr) public override onlyOwner {
        allModuleInfo[_moduleName] = _moduleAddr;
        if(keccak256(bytes(_moduleName)) == keccak256(bytes("FUND"))){
            fundAddr = getModuleAddr(_moduleName);
        }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("RISK"))){
            riskAddr = getModuleAddr(_moduleName);
        }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("SWAPTRADE"))){
            swapTradeAddr = getModuleAddr(_moduleName);
        }else if(keccak256(bytes(_moduleName)) == keccak256(bytes("MINE"))){
            mineAddr = getModuleAddr(_moduleName);
        }
    }
    function getModuleAddr(string memory _moduleName) public view returns (address moduleAddr) {
        moduleAddr = allModuleInfo[_moduleName];
        require(moduleAddr != address(0), "getModuleAddr: module err");
    }
    function getQuoteFactoryAddr() public override returns (address){
        return quoteFactoryAddr;
    }
    // LP充值
    function lpDeposit(uint256 _tokenAmount,bool mine) public {
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this), _tokenAmount);
        //IERC20(tokenAddr).transferFrom(msg.sender, address(this), _tokenAmount);
        uint256 lpAmount = IFund(fundAddr).deposit(msg.sender, _tokenAmount);
        if(mine == false){
            _mint(msg.sender,lpAmount);
            emit LPDeposit(msg.sender, lpAmount, 0);
        }else{
            _mint(address(this),lpAmount);
            (uint256 teemoTokenAmount,uint256 userTeemoTokenAmount) = IMine(mineAddr).deposit(msg.sender,lpAmount);
            if(IPoolFactory(poolFactoryAddr).getStatus()){
                IPoolFactory(poolFactoryAddr).mintToken(teemoTokenAmount);
                IPoolFactory(poolFactoryAddr).safeTeemoTransfer(msg.sender,userTeemoTokenAmount);
            }else{
                IPoolFactory(poolFactoryAddr).updateBonus(msg.sender,userTeemoTokenAmount);
            }
            emit LPDeposit(msg.sender, lpAmount, userTeemoTokenAmount);
        }    
    }

    // LP参与挖平台币
    function startMine(uint256 _lpAmount) public {
        TransferHelper.safeTransferFrom(address(this),msg.sender,address(this), _lpAmount);
        //transferFrom(msg.sender, address(this), _lpAmount);
        (uint256 teemoTokenAmount, uint256 userTeemoTokenAmount) = IMine(mineAddr).deposit(msg.sender,_lpAmount);
        if(IPoolFactory(poolFactoryAddr).getStatus()){
            IPoolFactory(poolFactoryAddr).mintToken(teemoTokenAmount);
            IPoolFactory(poolFactoryAddr).safeTeemoTransfer(msg.sender,userTeemoTokenAmount);
        }else{
            IPoolFactory(poolFactoryAddr).updateBonus(msg.sender,userTeemoTokenAmount);
        }
        emit StartMine(msg.sender, _lpAmount, teemoTokenAmount);
    }

    // LP提现
    function lpWithdraw(uint256 _lpAmount) public {  
        TransferHelper.safeTransferFrom(address(this),msg.sender,address(this),_lpAmount);
        //transferFrom(msg.sender, address(this), _lpAmount);
        uint256 tokenAmount = IFund(fundAddr).withdraw(msg.sender, _lpAmount);
        _burn(address(this),_lpAmount);// 销毁lptoken
        //IERC20(tokenAddr).transfer(msg.sender, tokenAmount); // 转账提取的token
        TransferHelper.safeTransfer(tokenAddr,msg.sender,tokenAmount);
        emit LPWithdraw(msg.sender, tokenAmount);
    }

    // LP退出挖平台币
    function stopMine(uint256 _lpAmount) public {
        (uint256 teemoTokenAmount, uint256 userTeemoTokenAmount) = IMine(mineAddr).withdraw(msg.sender,_lpAmount); //帮用户自动提取lptoken退出挖矿TMO,lptoken先打到合约上
        //transfer(msg.sender, _lpAmount);
        TransferHelper.safeTransfer(address(this),msg.sender,_lpAmount);
        if(IPoolFactory(poolFactoryAddr).getStatus()){
            IPoolFactory(poolFactoryAddr).mintToken(teemoTokenAmount);
            IPoolFactory(poolFactoryAddr).safeTeemoTransfer(msg.sender,userTeemoTokenAmount);
        }else{
            IPoolFactory(poolFactoryAddr).updateBonus(msg.sender,userTeemoTokenAmount);
        }
        emit StopMine(msg.sender, _lpAmount, userTeemoTokenAmount);
    }

    // 永续合约创建限价单
    function openLimitSwap(string memory _symbol,uint256 _limitPrice,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice) public {
        //IERC20(tokenAddr).transferFrom(msg.sender, address(this), _tokenAmount);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),_tokenAmount);
        (bytes32 orderID, uint256 openPrice) = ISwapTrade(swapTradeAddr).openLimitSwap(msg.sender,_symbol,_limitPrice,_tokenAmount,_lever,_bsFlag,_pLimitPrice,_lLimitPrice);
        emit OpenLimitSwap(orderID, openPrice);
    }

    // 永续合约取消限价单
    function cancelLimitSwap(bytes32 _orderID) public {
        uint256 tokenAmount = ISwapTrade(swapTradeAddr).cancelLimitSwap(msg.sender,_orderID);
        //IERC20(tokenAddr).transferFrom(msg.sender, address(this), tokenAmount);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),tokenAmount);
        emit CancelLimitSwap(tokenAmount);
    }

    // 永续合约成交限价单
    function tradeLimitSwaps(bytes32[] memory _orderIDs,uint256 _blockIndex) public {
        for(uint256 i=0;i<_orderIDs.length;i++){
            tradeLimitSwap(_orderIDs[i],_blockIndex);
        }
    }
    function tradeLimitSwap(bytes32 _orderID,uint256 _blockIndex) public {
        (bool success,address userAddr,uint256 tokenAmount) = ISwapTrade(swapTradeAddr).tradeLimitSwap(_orderID,_blockIndex);
        if(success){
            emit TradeLimitSwap(userAddr,tokenAmount);
        }
    }        

    // 永续合约市价建仓
    function openMarketSwap(string memory _symbol,uint256 _tokenAmount,uint256 _lever,uint256 _bsFlag,uint256 _pLimitPrice,uint256 _lLimitPrice, uint256 _maxPrice) public {
        //IERC20(tokenAddr).transferFrom(msg.sender, address(this), _tokenAmount);
        TransferHelper.safeTransferFrom(tokenAddr,msg.sender,address(this),_tokenAmount);
        (bytes32 orderID, uint256 openPrice) = ISwapTrade(swapTradeAddr).openMarketSwap(msg.sender,_symbol,_tokenAmount,_lever,_bsFlag,_pLimitPrice,_lLimitPrice, _maxPrice);
        emit OpenMarketSwap(orderID, openPrice);
    }

    // 永续合约市价平仓
    function closeMarketSwap(bytes32 _orderID) public {
        (uint256 closePrice,uint256 plFlag,uint256 plAmount,uint256 tradeAmount) = ISwapTrade(swapTradeAddr).closeMarketSwap(msg.sender, _orderID);
        IFund(fundAddr).tradePL(msg.sender, tradeAmount, plFlag, plAmount);
        uint256 mintAmount = tradeAmount.div(10);
        IPoolFactory(poolFactoryAddr).mintGovToken(msg.sender, mintAmount);
        if (plFlag == 1) {// 交易用户盈利了
            //IERC20(tokenAddr).transfer(msg.sender, tradeAmount.add(plAmount));
            if(IPoolFactory(poolFactoryAddr).getStatus()){
                TransferHelper.safeTransfer(tokenAddr,msg.sender,tradeAmount.add(plAmount));
            }else{
                TransferHelper.safeTransfer(tokenAddr,msg.sender,tradeAmount);
            }
        } else {
            //IERC20(tokenAddr).transfer(msg.sender, tradeAmount.sub(plAmount));
            if(IPoolFactory(poolFactoryAddr).getStatus()){
                TransferHelper.safeTransfer(tokenAddr,msg.sender,tradeAmount.sub(plAmount));
            }else{
                TransferHelper.safeTransfer(tokenAddr,msg.sender,tradeAmount);
            }
        }
        emit CloseMarketSwap(closePrice, plFlag, plAmount);
    }

    // 自动平仓(止盈止损强平)
    function closeLimitSwaps(bytes32[] memory _orderIDs,uint256 _blockIndex) public {
        for(uint256 i=0;i<_orderIDs.length;i++){
            closeLimitSwap(_orderIDs[i],_blockIndex);
        }
    }
    function closeLimitSwap(bytes32 _orderID,uint256 _blockIndex) public {
        (bool success,address userAddr,uint256 closePrice,uint256 closeType,uint256 plFlag,uint256 plAmount,uint256 tradeAmount) = ISwapTrade(swapTradeAddr).closeLimitSwap(_orderID,_blockIndex);
        if(success){
            IFund(fundAddr).tradePL(userAddr, tradeAmount, plFlag, plAmount);
            uint256 mintAmount = tradeAmount.div(10);
            IPoolFactory(poolFactoryAddr).mintGovToken(userAddr, mintAmount);
            if (plFlag == 1) {// 交易用户盈利了
                //IERC20(tokenAddr).transfer(userAddr, tradeAmount.add(plAmount));
                if(IPoolFactory(poolFactoryAddr).getStatus()){
                    TransferHelper.safeTransfer(tokenAddr,userAddr,tradeAmount.add(plAmount));
                }else{
                   TransferHelper.safeTransfer(tokenAddr,userAddr,tradeAmount);
                }
            } else {
                //IERC20(tokenAddr).transfer(userAddr, tradeAmount.sub(plAmount));
                if(IPoolFactory(poolFactoryAddr).getStatus()){
                    TransferHelper.safeTransfer(tokenAddr,userAddr,tradeAmount.sub(plAmount));
                }else{
                   TransferHelper.safeTransfer(tokenAddr,userAddr,tradeAmount);
                }
            }
            emit CloseLimitSwap(userAddr,closePrice,closeType,plFlag,plAmount);
        }
    }

    // 永续合约订单更新止盈止损根据价格
    function updateSwapByPrice(bytes32 _orderID,uint256 _pLimitPrice,uint256 _lLimitPrice) public {
        (uint256 pLimitRate,uint256 lLimitRate) = ISwapTrade(swapTradeAddr).updateSwapByPrice(msg.sender, _orderID,_pLimitPrice,_lLimitPrice);
        emit UpdateSwap(pLimitRate, lLimitRate);
    }

    // 永续合约订单更新止盈止损根据比例
    function updateSwapByRate(bytes32 _orderID,uint256 _pLimitRate,uint256 _lLimitRate) public {
        (uint256 pLimitPrice,uint256 lLimitPrice) = ISwapTrade(swapTradeAddr).updateSwapByRate(msg.sender, _orderID,_pLimitRate,_lLimitRate);
        emit UpdateSwap(pLimitPrice, lLimitPrice);
    }    
}
